import sesionReducer from "./sesionReducer";
import openSnackbarReducer from "./sesionReducer";

export const mainReducer=({sesion,openSnacksbar},action)=>{
    return{
        sesion:sesionReducer(sesion,action),
        openSnackbar:openSnackbarReducer(openSnacksbar,action)
    }
}
